    "2016-11-25T21:05:57.753584",nt"name": "2008-baccalaureate-and-beyond-longitudinal-study",nt"isopen":
    true,nt"url": null,nt"notes": "The Baccalaureate and Beyond Longitudinal
    Study, 2008 (B&B:08), is a study that is part of the Baccalaureate and Beyond Longitudinal
    Study (B&B) program. B&B:08 (http://nces.ed.gov/surveys/B&B/) is a longitudinal
    survey that examines studentsufffd education and work experiences as they complete
    a bachelorufffds degree, with a special emphasis on the experiences of new elementary
    and secondary teachers. The study was conducted using mail, internet, secure server
    and fax, and File Transfer Protocol (FTP) for postsecondary institutions and computer-assisted
    telephone interviewing (CATI), and the internet for postsecondary students. Postsecondary
    students and institutions which participated in B&B:08 were sampled from the 2008
    National Postsecondary Student Aid Study (NPSAS:08). Key statistics produced from
    B&B:08 include bachelorufffds degree recipientsufffd workforce participation, income
    and debt repayment, entry into and persistence through graduate school programs,
    undergraduate experience, demographic backgrounds, expectations regarding graduate
    study and work, and participation in community service.",nt"license_title":
